import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";

const Dogs = (props) => {
  const [dogs, setDogs] = useState();
  //let j;
  useEffect(() => {
    // j = y();
    let a = y();
    a.then((r) => setDogs(r));
  }, []);
  console.log("hola", dogs);
  async function y() {
    const r = await fetch("http://localhost:3001/dogs").then((d) => d.json());
    // console.log(r)
    return r;
  }
  return (
    <div>
      if(dogs !== undefined){
        dogs.map((e, i) => {
        //con la key React sabe de qué componente estamos "hablando"
        return (
          <div key={e.id}>
            <img src={e.image} alt="Debería haber una foto" />
            <p>{e.name}</p>
            <p>{e.temperament}</p>
            <p>{e.weight_min}</p>
            <p>{e.weight_max}</p>
          </div>
        );
      })
      } else return "Cargando.."
    </div>
  );
};
export default Dogs;
